export default function Expressions() {

    const myExpression = "Hello from myExpression Component!";
    const imageBackground = 'https://www.ilusso.com/wp-content/uploads/Mask_Group_26.png';
    const duplicate = (value : number) => value * 2;
    return (
        <>
            <h1>Expressions</h1>
            <h2>{myExpression.toUpperCase()}</h2>
            <h3>The double of 3 is {duplicate(3)}</h3>
            <img src={imageBackground} alt="background" />
        </>
    )
}
